/*!

=========================================================
* Material Dashboard React - v1.9.0
=========================================================

* Product Page: https://www.creative-tim.com/product/material-dashboard-react
* Copyright 2020 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/material-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React, { Component } from "react";
import ReactDOM from "react-dom";
import { createBrowserHistory } from "history";
import { Router, Route, Switch, Redirect } from "react-router-dom";

import firebase from "firebase";
// import "firebase/database";
// import {
//   FirebaseDatabaseProvider,
//   FirebaseDatabaseNode
// } from "@react-firebase/database";
import { db_config } from "config";

import dashboard from "views/Dashboard/Dashboard"

// core components
import Admin from "layouts/Admin.js";
import RTL from "layouts/RTL.js";

import "assets/css/material-dashboard-react.css?v=1.9.0";
import Dashboard from "views/Dashboard/Dashboard";

import {
  labels,
  lightlevels1,
  humiditylevels1,
  waterlevels1,
  lightlevels2,
  humiditylevels2,
  waterlevels2,
  lightlevels3,
  humiditylevels3,
  waterlevels3,
} from "variables/charts.js";
import { light } from "@material-ui/core/styles/createPalette";

const hist = createBrowserHistory();

class App extends Component {
  constructor() {
    super()

    this.app = firebase.initializeApp(db_config);
    this.auth = firebase.auth()
    this.database = firebase.database().ref().child("vedantbahadur");

    this.state = {
      speed: [],
    };
  }

  componentDidMount() {
    console.log("didmount")
    this.auth.signInWithEmailAndPassword("test@gmail.com", "VedantTest").then(value => {
      console.log(value);
      console.log(value.user.phoneNumber);
      this.database.child("light").on('value', (snap) => {
        console.log("printing")
        var lightArray = snap.val().slice(-7);
        for (var count = 0; count < lightArray.length; count +=1) {
          lightArray[count] = Math.round((lightArray[count] * 10000 / 4095.0)) / 100
        }
        var labels = ["8:00", "9:00", "10:00", "11:00", "12:00", "13:00", "14:00"];
        console.log(labels)
        console.log(lightArray)
        lightlevels1.data = {
          labels: labels,
          series: [lightArray]
        }
        this.setState({
          speed: snap.val()
        });
      })
    })

  }

  render() {
    console.log("rendering");
    return (
      <Router history={hist}>
        <Switch>
          <Route path="/admin" component={Admin} />
          {/* <Route path="/rtl" component={RTL} /> */}
          {/* <Redirect from="/" to="/admin/dashboard" /> */}
          <Dashboard dataIn={this.state.speed}></Dashboard>
        </Switch>
      </Router>
      // <div>
      //   <h1>Count is {this.state.speed}</h1>
      // </div>
    );
  }
}
ReactDOM.render(
  <App />,
  document.getElementById("root")
);
